import React from 'react';

function QuinaCards() {
  return (
    <div>
    {cardNumbers.map((num) => (
      <span key={num} onClick={() => handleClick(num) }>
        { num }
      </span>
      ))}
  </div>
  );
}

export default QuinaCards;
